from detect import run
import torch
import cv2
import base64
from pathlib import Path
import os
from PIL import Image


class Detector():
    def __init__(self, base64imgstr):
        # self.weights = weights
        # self.source = 'https://youtu.be/KBsqQez-O4w'
        self.filename = 'infer.jpg'
        self.decodeImage(base64imgstr, self.filename)
        self.source = self.filename

    def detect(self):
        run(source=self.source, project='runs/', save_crop=True)

    def detect_action(self):
        with torch.no_grad():
            self.detect()
        bgr_image = cv2.imread("output.jpg")
        im_rgb = cv2.cvtColor(bgr_image, cv2.COLOR_RGB2BGR)
        cv2.imwrite('color_img.jpg', im_rgb)
        opencodedbase64 = self.encodeImageIntoBase64("color_img.jpg")
        result = {"image": opencodedbase64.decode('utf-8')}
        return result

    def crop_detection(self):
        import glob
        path=Path("runs",'exp')
        sep=""
        last_inference = Path(glob.glob(f"{path}{sep}*")[-1])
        label_path = Path(last_inference, 'crops', 'car')
        print(label_path)
        print(os.getcwd())
        result={}
        if os.path.exists(label_path):
            for index, file in enumerate(glob.glob(f"{label_path}/{sep}*")):
                opencodedbase64 = self.encodeImageIntoBase64(file)
                result[index] = opencodedbase64
                self.decodeImage(opencodedbase64, 'file.png')

    @staticmethod
    def encodeImageIntoBase64(croppedImagePath):
        with open(croppedImagePath, "rb") as f:
            return base64.b64encode(f.read())
    
    @staticmethod
    def decodeImage(imgstring, fileName):
        imgdata = base64.b64decode(imgstring)
        with open(fileName, 'wb') as f:
            f.write(imgdata)
            f.close()


det = Detector(base64imgstr="""""")
det.detect()
det.crop_detection()